package com.alan.leetcode.hard;

import java.util.HashMap;
import java.util.Map;

public class MinimumWindowSubstring {

	public static void main(String[] args) {

		MinimumWindowSubstring sol = new MinimumWindowSubstring();

		System.out.println(sol.minWindow("ADOBECODEBANC", "ABC")); // "BANC"
		System.out.println(sol.minWindow("a", "a")); // "a"
		System.out.println(sol.minWindow("a", "aa")); // ""

		String s = "";
		String t = "";
		System.out.println(sol.minWindow(s, t)); // 

	}

	public String minWindow(String s, String t) {

		// Count chars occur in ADOBECODEBANC
		Map<Character, Integer> window = new HashMap<>();

		// Count chars need in ABC
		Map<Character, Integer> need = new HashMap<>();
		for (int i = 0; i < t.length(); i++) {
			char c = t.charAt(i);
			need.put(c, need.getOrDefault(c, 0) + 1);
		}

		// initialize the left and right index of the window
		int left = 0, right = 0;
		int valid = 0;

		// Record the start index of the min substring and its length
		int start = 0;
		int len = Integer.MAX_VALUE;

		while (right < s.length()) {

			// move window right
			char c = s.charAt(right);
			right++;

			// update window char count which exist in need
			if (need.getOrDefault(c, 0) > 0) { // ABC
				window.put(c, window.getOrDefault(c, 0) + 1); // ADOBEC
				
				// Be careful!!! => Integer == Integer 
				if (window.get(c).intValue() == need.get(c).intValue()) { 
					valid++; // 3
				}
			}

			// When substring is matched...
			while (valid == need.size()) {

				// Update min length of the substring
				if (right - left < len) { // 5 - 0 = 5 < INF -> min string len
					start = left; // start = 0
					len = right - left; // len = 5 - 0 = 5
				}

				// move window left
				char d = s.charAt(left); // A
				left++; // left = 1

				// update window char count which exist in need
				if (need.getOrDefault(d, 0) > 0) { // A: 1
					
					// Be careful!!! => Integer == Integer 
					if (window.get(d).intValue() == need.get(d).intValue()) { 
						valid--; // 2
					}
					window.put(d, window.getOrDefault(d, 0) - 1);
				}
			}

		}

		return len == Integer.MAX_VALUE ? "" : s.substring(start, start + len);
	}
}
